comment.body:
Polling all possible keys every frame is inefficient. Consider only updating states for keys that have actually changed by using GLFW callbacks or maintaining a smaller set of tracked keys.
```suggestion
		// Only copy previous states; actual state updates happen in callbacks
		s_PreviousKeyStates = s_CurrentKeyStates;
		s_PreviousButtonStates = s_CurrentButtonStates;
	}

	// GLFW key callback
	void Input::KeyCallback(GLFWwindow* window, int key, int scancode, int action, int mods)
	{
		if (key < GLFW_KEY_SPACE || key > GLFW_KEY_LAST)
			return;
		s_CurrentKeyStates[(KeyCode)key] = (action == GLFW_PRESS || action == GLFW_REPEAT);
	}

	// GLFW mouse button callback
	void Input::MouseButtonCallback(GLFWwindow* window, int button, int action, int mods)
	{
		if (button < GLFW_MOUSE_BUTTON_1 || button > GLFW_MOUSE_BUTTON_LAST)
			return;
		s_CurrentButtonStates[(MouseButton)button] = (action == GLFW_PRESS);
